import React from 'react';
import { useEffect } from "react";
import { useNavigate, Link } from 'react-router-dom';
import ChkAuth from './chkAuth';
import Google from '../images/icons/icon-google.png'
import SendData from './SendData';
import ResetPassword from './ResetPassword';
import UpdateUsername from './UpdateUsername';
import UpdateEmail from './UpdateEmail';
import UpdateMobile from './UpdateMobile';
import RequestOTP from './RequestOTP';
import { useAlert } from "react-alert";

export default function RenderUpdateDetails (props) {

	const Navigate = useNavigate();
	const [updateType, setUpdateType] = React.useState("init");
	const [username, setUsername] = React.useState(props.username)
	const [securitylevel, setSecurityLevel] = React.useState(props.securitylevel)
	const [address, setAddress] = React.useState("unassigned")
	const [userDetails, setUserDetails] = React.useState({username: "", password: "", email: "", mobile: ""})

	useEffect( () => { //check if signed in and go to profile page
		ChkAuth().then(user => {
		  if (user) {
		  Navigate("/profile/" + user + "/home")
		  } 
		})
	},[]);

	console.log("resert request username:", username)



	async function GetOTP (requestType) {
			securitylevel === 1 && setUpdateType(requestType) // bypass otp as user only uses password
			RequestOTP(username, "both").then((response) => {
				if (( "errors" in response )) {
					console.log("error bak from otp request", response.errors[0].message)
					alertError(response.errors[0].message)
				} else {
					setAddress( response.data.SecureUpdate.Token.split(":"))
					setUpdateType(requestType)
				}
			})
	}



	function alertError(error){
		const delimiter = '= '
		const start = 2,
		tokens = error.split(delimiter).slice(start),
		result = tokens.join(delimiter); // those.that
		alert.show(result)
	}


	const handleInputChange = (event) => {
		const { name, value } = event.target;
		setUserDetails(prevDetails => ({ ...prevDetails, [name]: value }));
	  };



	function LandingPage ()	{
		switch (updateType) { 
			case "password":
				return <ResetPassword username={username} address ={address} />
			break
			case "username":
				return <UpdateUsername username={username} address ={address}/>
			break
			case "email":
				return <UpdateEmail username={username}  address ={address}/>
			break
			case "mobile":
				return <UpdateMobile username={username}  address ={address} />
			break
			default:
				return (
					<>
						<span className="login100-form-title p-b-53">
						<h3><i class="fa fa-lock fa-4x"></i></h3>
						</span>
						{/* <select  onChange={event => getOTP(event.target.value)}>
							<option value = "Select">Select</option>
							<option value="mobile" >Mobile</option>
							<option value="email">Email</option>
							<option value="username">Username</option>
							<option value="password">Password</option>
						</select> */}
						 <form onSubmit={GetOTP()}>
							<label htmlFor="name">Name:</label>
							<input type="text" id="name" name="name" value={userDetails.name} onChange={handleInputChange} required />

							<label htmlFor="email">Email:</label>
							<input type="email" id="email" name="email" value={userDetails.email} onChange={handleInputChange} required />

							<label htmlFor="password">Password:</label>
							<input type="password" id="password" name="password" value={userDetails.password} onChange={handleInputChange} required />

							<label htmlFor="address">Address:</label>
							<textarea id="address" name="address" value={userDetails.address} onChange={handleInputChange} required />

							<label htmlFor="phone">Phone:</label>
							<input type="tel" id="phone" name="phone" value={userDetails.phone} onChange={handleInputChange} required />

							<button type="submit">Update Details</button>
						</form>
						<div className="w-full text-center p-t-55">
							<button onClick={() => window.location.reload(false)}>Back to log in</button>
						</div>
					</>
				)

		}}

  return (  
    <>
		<LandingPage/>
	</>


  )
};
